import React from 'react';

const Navbar = () => {
  return (
    <nav className="bg-white p-4 shadow-md">
      <div className="container mx-auto flex items-center justify-between">
        {/* Left side: Logo and Photo */}
        <div className="flex items-center space-x-4">
          <img src="/path-to-logo.png" alt="Logo" className="h-8" />
          <img src="/path-to-photo.jpg" alt="Profile" className="h-8 w-8 rounded-full" />
        </div>

        {/* Center: Navigation Links */}
        <div className="hidden md:flex space-x-8">
          <a href="#" className="text-black hover:text-gray-700">Home</a>
          <a href="#" className="text-black hover:text-gray-700">About</a>
          <a href="#" className="text-black hover:text-gray-700">Services</a>
          <a href="#" className="text-black hover:text-gray-700">Contact</a>
        </div>

        {/* Right side: Login Button */}
        <div className="flex items-center">
          <button className="text-black border border-black px-4 py-2 rounded hover:bg-black hover:text-white transition duration-300">
            Login
          </button>
        </div>

        {/* Mobile Menu Button */}
        <div className="md:hidden flex items-center">
          <button className="text-black focus:outline-none">
            <svg className="w-6 h-6" fill="none" stroke="currentColor" viewBox="0 0 24 24" xmlns="http://www.w3.org/2000/svg">
              <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M4 6h16M4 12h16M4 18h16"></path>
            </svg>
          </button>
        </div>
      </div>

      {/* Mobile Menu */}
      <div className="md:hidden">
        <a href="#" className="block px-4 py-2 text-black hover:bg-gray-200">Home</a>
        <a href="#" className="block px-4 py-2 text-black hover:bg-gray-200">About</a>
        <a href="#" className="block px-4 py-2 text-black hover:bg-gray-200">Services</a>
        <a href="#" className="block px-4 py-2 text-black hover:bg-gray-200">Contact</a>
      </div>
    </nav>
  );
};

export default Navbar;
